import PageContent from "../components/PageContent";
import { useRouteError } from "react-router-dom";
export default function () {
  const err = useRouteError();
  console.log(err);
  return (
    <PageContent title={JSON.parse(err.data).message}>
      <p>Error occured!</p>
    </PageContent>
  );
}
